private static String toString(String[] strArray) {
  if (strArray==null || strArray.length==0) {
    return "";
  }
  StringBuilder buf = new StringBuilder(strArray[0]);
  for (int i=1; i<strArray.length; i++) {
    buf.append(' ');
    buf.append(strArray[i]);
  }
  return buf.toString();
}
